import '../../style/main/rechargeBox.less'

import FN from "../common/fn"
// window.SDKAPI.__rechargeBox__ = function(data) {

export default function(data) {
  let div = document.createElement('div')
  div.innerHTML = `
  <div id="recharge-box">
    <div id="recharge-box-3k">
      <a href="javascript:;" class="close" id="recharge-close"></a>
      <h3>确认支付方式</h3>
      <p class="name">金额</p>
      <p class="num">￥<span>${data.amount}</span></p>
      <div class="list">
        <a href="${data.alipay}">
          <img src="data:image/png;base64,"/>
          <p>支付宝支付</p>
        </a>
        <a href="${data.wxpay}">
          <img src="data:image/png;base64,"/>
          <p>微信支付</p>
        </a>
      </div>
    </div>
  </div>
  `



  let Webview = document.createElement('div')
  Webview.innerHTML = `
  <div id="recharge-box">
  <div id="recharge-box-3k">
    <a href="javascript:;" class="close" id="recharge-close"></a>
    <h3>确认支付方式</h3>
    <p class="name">金额</p>
    <p class="num">￥<span>${data.amount}</span></p>
    <div class="list">
      <a href="javascript:void(0);" onclick="FN.App_alipay('${data.alipay}')">
        <img src="data:image/png;base64,"/>
        <p>支付宝支付</p>
      </a>
      <a href="${data.wxpay}">
      <a href="javascript:void(0);" onclick="FN.App_wxpay('${data.wxpay}')">
        <img src="data:image/png;base64,"/>
        <p>微信支付</p>
      </a>
    </div>
  </div>
</div>
  `
  //判断是否安卓微端
  if ((window.WebViewJavascriptBridge || window.BRIDGE.H5CallClient) && window.navigator.userAgent.indexOf('UCBrowser') == -1) {
    return Webview
  } else{
    return div
  }
  // return Webview
}
